import AppLayout from '../components/AppLayout';

const Home = () => {
    return (

        <AppLayout>
            Next를 활용 및 적용하였습니다.<br />
            현재 백엔드 작업중이며 백엔드가 끝나는대로 인덱스 페이지 및 나머지
            세부 작업 예정입니다.
        </AppLayout>
    )
}

export default Home;
